export default function Tracks({ tracks, handleToggle }) {


  return (
    <div>
      <h1>Fearless (Taylor's Version)</h1>
      <Ul>
        {tracks.map((track, i) => {
          return (
            <Track track={track} handleToggle={handleToggle} key={i}/>
          )
        }
        )}
      </Ul>
    </div>
  );
}
